# 1. training argument -> ÌïôÏäµÌïòÎäîÎç∞ ÌïÑÏöîÌïú Ï†ïÎ≥¥, Ïù∏Ïûê ÏÑ§Ï†ïÌïòÍ∏∞(Î™®Îç∏ Ï†ÄÏû• ÎîîÎ†âÌÜ†Î¶¨, ÌïôÏäµ ÏóêÌè¨ÌÅ¨ Ïàò, Î∞∞Ïπò ÌÅ¨Í∏∞ Îì± ÏÑ§Ï†ï)
