# 3. ÌïôÏäµ Ïã§Ìñâ(TrainerÎ•º train() ÏãúÌÇ§Í∏∞)

from transformers import Trainer, TrainingArguments, EarlyStoppingCallback
import numpy as np
from sklearn.metrics import f1_score, accuracy_score, classification_report
# f1_scoreÎäî ÌèâÍ∞ÄÌï®Ïàò

# ÌèâÍ∞ÄÌï®Ïàò Ï†ïÏùò(Î©ÄÌã∞ ÎùºÎ≤®Ïù¥Í∏∞ÎïåÎ¨∏Ïóê ÏûÑÍ≥ÑÍ∞í 0.5 Ïù¥ÏÉÅÏù¥Î©¥ 1Î°ú ÌåêÎã®)
def compute_metrics(pred):
  logits, labels = pred
  if isinstance(logits, tuple):
    logits = logits[0]
  preds = (logits > 0.5).astype(int)
  macro_f1 = f1_score(labels, preds, average="macro")
  accuracy = accuracy_score(labels, preds)
  return {
      "macro_f1": macro_f1,
      'accuracy': accuracy}

# ÌõàÎ†® ÌååÎùºÎØ∏ÌÑ∞ ÏÑ§Ï†ï
training_args = TrainingArguments(
    output_dir = "/content/drive/MyDrive/toxic_comment_project/outputs",
    num_train_epochs = 7,
    per_device_train_batch_size = 16,
    per_device_eval_batch_size = 16,
    learning_rate=1e-5,
    weight_decay=0.05,
    warmup_ratio=0.05,
    eval_strategy='epoch',
    save_strategy='epoch',
    logging_dir='/content/drive/MyDrive/toxic_comment_project/logs',
    logging_steps=50,
    load_best_model_at_end=True, # validation lossÏùÑ Í∏∞Ï§ÄÏúºÎ°ú ÏµúÏ†ÅÏùò Î™®Îç∏ ÏÑ†ÌÉù
    metric_for_best_model='macro_f1',
)

# Trainer Í∞ùÏ≤¥ ÏÉùÏÑ±
trainer = Trainer(
    model = model,
    args = training_args,
    train_dataset = ToxicDataset(train_encodings, Y_train),
    eval_dataset = ToxicDataset(valid_encodings, Y_valid),
    compute_metrics = compute_metrics,
    tokenizer = tokenizer,
    callbacks=[EarlyStoppingCallback(early_stopping_patience=2, early_stopping_threshold=0.002)]
)

# Ïã§Ï†úÎ°ú ÌõàÎ†® ÏãúÌÇ§Í∏∞
trainer.train()

